('MABasic Series','Electric Portable Magnetic Drills','CS Unitecs MABasic line of magnetic drills consists of powerful and reliable machines at an affordable price. These professional-grade workhorses have a hole cutting capacity of 1-3/8 diameter to 3-1/16 diameter with annular cutters in structural steel and other metals. With included geared drill chuck, these models easily convert to a standard drill press with a 10 stroke for conventional twist drills. CS Unitecs MABasic magnetic drills are equipped with an Electronic Safety Shutoff Sensor and internal lubrication system. Standard equipment includes a lubrication bottle, safety strap, carabin hook, allen keys, pilot pin and carrying case.','https://drive.google.com/file/d/1WFMiT_rhE0syr-Z6VJ6dUU_gOfcWTVPU/view?usp=sharing',''),
('MAB 525','Portable Magnetic Drills','The MAB 525 from CS Unitec is a high-power portable magnetic drilling machine that is ideal for production use. Drill up to 2-1/2\" dia. with annular cutters. Twist drill up to 1\" dia. Tap up to 15/16\" dia. 6-1/3\" stroke length. Order MAB 525 SB for optional swivel base, providing 20 movement left and right and 5/8\" forward and backward. Equipped with a 2-speed, variable-speed, 14.5-Amp reversible motor, the MAB 525 is designed for continuous use with electronic torque control. Equipped with automatic internal lubrication and quick-change keyless cutter system for 3/4\" Weldon shank. Advanced safety features include an electronic safety shutoff sensor, emergency-off function and magnetic force indicator.','https://drive.google.com/file/d/1I_-bsuyFuWibsvfVdwu0xHq2jVJtibss/view?usp=sharing',''),
('Model AB-4300-2','AIRBOR AB-4300 Portable Pneumatic Magnetic Drill',' Inherently safer than electromagnetic drills in hazardous atmospheres and wet environments where electricity requires \"hot work permits\"\n ATEX certified\n Industrys first completely air-operated\nmagnetic drill  NO ELECTRICITY!\n Fail-safe permanent magnet is activated\r\n\"on\" and \"off\" by air pressure; in the\r\nevent of a loss of air flow, the magnet\r\nwill not disengage\n 1600 lbs. magnet holding strength','https://drive.google.com/file/d/1w_z9QElzDsTZkdOwtW7xLK3dL4Smu2az/view?usp=sharing',''),
